import Link from 'next/link';
import styled from 'styled-components';

const NavbarBlock = styled.div`
  border: 1px solid black;
  height: 4rem;
`;

const Navbar = () => {
  return <NavbarBlock></NavbarBlock>;
};

export default Navbar;
